import React from 'react';
import CreateIcon from '@mui/icons-material';
import DeleteOutLine from '@material-ui/icons/DeleteOutline';
import Card from '@mui/material/Card';
import CardContent from '@mui/material/CardContent';
import EmailIcon from '@mui/icons-material/Email';
import WorkIcon from '@mui/icons-material/Work';

const Details = () => {
  return (

<div className="container mt-3">

    <h1 style={{fontWeight:400}}> Welcome Aman Prasad</h1>
    <Card sx={{minWidth:600}}>
        <CardContent>
            <div className="row">


            <div className="left-view col-lg-6 col-md-6 col-12">
                <h3 className='mt-3'>Name: <span style={{fontWeight:400}}>Aman Prasad</span></h3>
                <h3 className='mt-3'>Age: <span style={{fontWeight:400}}>21</span></h3>
                <p className='dp'><EmailIcon/>Email:<span>amanprasad9843@gmail.com</span></p>
                <p className='dp'><WorkIcon/>Occupation:<span>Student</span></p>  


            </div>
            <div className="right-view col-lg-6 col-md-6 col-12">

                <p className='dp'><EmailIcon/>Phone:<span>+91 9427185995</span></p>
                <p className='dp'><WorkIcon/>Location:<span>Vapi</span></p>  
                <p className='dp'><WorkIcon/>Description:<span>Loresum isjdasid sijdisaudasd iajasudasdn</span></p> 


            </div>
            </div>
        </CardContent>
    </Card>

</div>
  );



};

export default Details;
